import { StyleSheet } from "@react-pdf/renderer"

import global from "./global"

export default StyleSheet.create({
  ...global,
  container: {
    display: "flex",
    fontSize: 13,
    width: "90%",
    padding: 10,
    margin: "0 auto",
    height: "auto",
    backgroundColor: "white",
  },
  email: {
    color: "black",
    textDecoration: "none",
    lineHeight: 1.5,
  },
})
